import React from 'react';
import useElements from './apiHooks/useElements'
function App() {
  const { data, put, setid, deleting, SetnewPost } = useElements()

  return (
    <div>
      {data.map(i => {
        console.log(i.style)
        return (
          <div>
            {i.tag !== 'img' ? <i.tag >{i.text}</i.tag> : <img src={i.src} />}
          </div>
        )
      })}
    </div >
  );
}

export default App;
